import React, { Component } from "react";
// import NotePage from "../components/NotePage";
import MyTabPanel from "../components/MyTabPanel";
import {
  Button,
} from "reactstrap";

class App extends Component {
  constructor() {
    super();
    this.state = {
      currentNoteID: null,
      currentNote: null,
      notes: null,
    };
  }

  onClickNewNote() {

  }

  render() {
    return (
      <div className="container">
        <MyTabPanel />
        <div>
          <Button onClick={this.onClickNewNote}> New Note </Button>
        </div>
      </div>
    );
  }
}

export default App;
